/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tinhTong` BEFORE INSERT ON `thanhtoan` FOR EACH ROW BEGIN
    DECLARE maphong VARCHAR (255) ;
    DECLARE giatien int (11) DEFAULT 0;
    DECLARE coc INT (11) DEFAULT 0;
    DECLARE giathue INT (11) DEFAULT 0;
    DECLARE x INT (11) DEFAULT 0;
    DECLARE count_dichvu INT (11) DEFAULT 0;
    DECLARE tong int(11) default 0;
    SET x = 1;
    while x <= 15 DO
    select Datcoc into coc from thuephong where Mathue = new.mathue;
    select Maphong into maphong from thuephong where Mathue = new.mathue;
    select Giathue into giathue from phong where Maphong = maphong;
    select count(Madichvu) into count_dichvu from sudungdichvu where Mathue = new.mathue and Madichvu = x;
    select Giatien into giatien from dichvu where Madichvu = x;
    set tong = tong + (giatien * count_dichvu);
    set x = x + 1;
    end while;
    set tong = tong + (giathue - coc);
    set
    new.thanhtien = -tong;
end */;;
